#https://oj.leetcode.com/problems/substring-with-concatenation-of-all-words/


class Solution():


    def checkTrue(self, idx, string, lenOfString, listOfWords, totalWords, lenOfWord):
        mapper = listOfWords[:]

        while idx < lenOfString:
            word = string[idx:idx+lenOfWord]
            if word in mapper:
                mapper.remove(word)
                idx += lenOfWord

                # found all words
                if len(mapper) == 0:
                    return  True
                # need more words
                continue
            else:
                # doesn't match
                return False

        # need more wordss
        return False



    # @param S, a string
    # @param L, a list of string
    # @return a list of integer
    def findSubstring(self, S, L):
        totalWords = len(L)
        if not totalWords:
            return []
        lenOfWord = len(L[0])
        lenOfString = len(S)
        output = []
        if totalWords * lenOfWord > lenOfString:
            return output
        i = 0
        while i < lenOfString:
            if self.checkTrue(i, S, lenOfString, L, totalWords, lenOfWord):
                output.append(i)
            i += 1
        return output




